import personalimg from "./images/top.webp"

function SectionFirst() {
    return (
     <div className="w-full h-screen pt-20 flex  ">
        <div>
            <h2 className=" font-sans font-bold primarytext">TradEdge<span>Institute</span></h2>
            <p>Empowering traders with knowledge, strategy, and confidence.</p>
        </div>
        <div>
            <img src="personalimg" />
        </div>
     </div>
    );
  }

  export default SectionFirst;
